import { useEffect } from "react";
import { useParams } from "react-router-dom";

function Product() {
  const [product, setProduct] = useState({});
  const { id } = useParams();

  useEffect(() => {
    axios
      .post("/product")
      .then((res) => setProduct(res.data))
      .catch((err) => console.log(err));
  }, []);

  return <div>{id}</div>;
}

export default Product;
